import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import styled from 'styled-components';
import TemCard from './Tem/TemCard'

function App() {
  const [temtem, setTemTem] = useState();
  useEffect( () => {
    axios.get(`https://temtem-api.mael.tech/api/temtems/TemTemApiTem[]`)
    .then(res => {
      setTemTem(res.data)
      console.log(res)})
    .catch(err=> console.log('from app err', err) 
    )
  }, [])

  // useEffect (()=> {
  //   axios.get('https://temtem-api.mael.tech/api/techniques')
  //   .then(res=> console.log('types', res))
  // },[])

  if(!temtem){
    return <div>loading...</div>
  }
  return (
    <div className="main-container">
      {temtem.map((obj, index) => {
        return <TemCard name={obj.name} image={obj.wikiPortraitUrlLarge} type={obj.types} key={index}/>
      })}
    </div>
  )
}

export default App;
